  import React from 'react'
  import { MDXTag } from '@mdx-js/tag'
  import {
  GoogleMap,
  LoadScript,
  GroundOverlay
} from "react-google-maps-api/lib"
import WithApiKey from "./WithApiKey"

const layoutProps = {

};
export default class MDXContent extends React.Component {
  constructor(props) {
    super(props)
    this.layout = null
  }
  render() {
    const { components, ...props } = this.props

    return <MDXTag
             name="wrapper"

             components={components}>

<MDXTag name="h1" components={components} props={{"id":"groundoverlay"}}>{`GroundOverlay`}</MDXTag>
<MDXTag name="pre" components={components}><MDXTag name="code" components={components} parentName="pre" props={{"className":"language-jsx"}}>{`<LoadScript
  id="script-loader"
  googleMapsApiKey={API_KEY}
  language={"en"}
  region={"EN"}
  version={"weekly"}
  libraries={[]}
  onLoad={() => console.log("script loaded")}
  loadingElement={<div>Loading...</div>}>

  <GoogleMap
    id="ground-overlay-example"
    mapContainerStyle={{
      height: "400px",
      width: "800px"
    }}
    zoom={13}
    center={{
      lat: 40.740,
      lng: -74.18
    }}
  >
    <GroundOverlay
      url="https://www.lib.utexas.edu/maps/historical/newark_nj_1922.jpg"
      bounds={{
        north: 40.773941,
        south: 40.712216,
        east: -74.12544,
        west: -74.22655
      }}
    />
  </GoogleMap>
</LoadScript>
`}</MDXTag></MDXTag>
<WithApiKey>
  {
    apiKey => (
      <LoadScript
        id="script-loader"
        googleMapsApiKey={apiKey}
        language={"en"}
        region={"EN"}
        version={"weekly"}
        libraries={[]}
        onLoad={() => console.log("script loaded")}
        loadingElement={<div>Loading...</div>}>
    <GoogleMap
      id="ground-overlay-example"
      mapContainerStyle={{
        height: "400px",
        width: "800px"
      }}
      zoom={13}
      center={{
        lat: 40.740,
        lng: -74.18
      }}
    >
      <GroundOverlay
        url="https://www.lib.utexas.edu/maps/historical/newark_nj_1922.jpg"
        bounds={{
          north: 40.773941,
          south: 40.712216,
          east: -74.12544,
          west: -74.22655
        }}
      />
    </GoogleMap>
  </LoadScript>
)
  }
</WithApiKey>
           </MDXTag>
  }
}
